// import components
// utils
import PublicRoute from "../../utils/PublicRoute.js";
import { Card2 } from "../../utils/cards.js";

// import media
import ReactLogo from "../../../media/react-logo2.svg";

const Skills = () => {
  const content = (
    <>
      <div className="skills-grid">
        <Card2 />
      </div>
    </>
  );

  return <PublicRoute content={content} />;
};

export default Skills;
